app.controller("profileController",["$scope",e=>{e.init=((r,t)=>{e.amazon_base_url=r;let s=JSON.parse(t);e.i18n_myAdsTitle=s.myAds.title,e.i18n_no_results=s.myAds.no_results,e.i18n_settings=s.myAds.settings,e.i18n_edit=s.myAds.edit,e.i18n_buy_power=s.myAds.buy_power,e.i18n_unpublish=s.myAds.unpublish,e.i18n_messagesTitle=s.messages.title,e.i18n_searchPlaceholder=s.messages.search})}]),app.config(["$routeProvider",e=>{e.when("/myads",{templateUrl:"partials/profile/myads.jade",controller:"myAdsController"}).when("/buypower/:id",{templateUrl:"partials/profile/buyPower.jade",controller:"buyPowerController"}).when("/messages/:id?",{templateUrl:"partials/profile/messages.jade",controller:"messagesController"}).when("/myfavourites",{templateUrl:"partials/profile/myFavourites.jade",controller:"myFavouritesController"}).otherwise({redirectTo:"/myads"})}]).run(["$rootScope","$location",function(e,r){e.$watch(function(){return r.path()},r=>{e.activetab=r.split("/")[1]})}]);